  false,\n\t\"url\": null,\n\t\"notes\": \"NASA's Jet Propulsion Laboratory (JPL)
  distributes science quality wind velocity data from the SeaWinds instrument onboard
  NASA's QuikSCAT satellite.  SeaWinds is a microwave scatterometer designed to measure
  surface winds over the global ocean.  Wind velocity fields are provided in zonal,
  meriodonal, and modulus sets. The reference height for all wind velocities is 10
  meters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
